const VideosLogic = ({video,fn,data,title}) => {
    return ( 
        <div className="vid">
        <h1>{title}</h1>
        <div className="videologic">
            {video.length==0? "There are no videos to be deleted":video.map((data)=>{
                return(
                <div className="video">
                    <div className="thumb">
                        <img src={data.thumbnail} alt="" />
                    </div>
                    <div className="details">
                        <div className="cicon">
                            <img src={data.channelIcon} alt="" />
                        </div>
                        <div className="title">
                            <span id='title'>{data.title}</span><br />
                            <span>{data.channelname}</span><br />
                            <span>{data.views}M views</span>
                            <a onClick={()=>fn(data.id)} style={{cursor:"pointer",marginLeft:"230px"}}>Delete</a>
                        </div>
                    </div>
                </div>    
            )})}
            <button onClick={()=>data([])}>Delete All</button>
        </div>
        </div>
     
     );
}
export default VideosLogic;
